-- ----------------------------
-- Records of cooker
-- ----------------------------
INSERT INTO `cooker` VALUES ('5', 'Kelly', '特级厨师', '29岁，小伙子，四川人，从事涉足餐饮行业已经有14年，以其精湛的厨艺及灵活的管理思维迅速成为同行业中的后起之秀，拥有丰富的厨房管理经验，曾任职于星际酒店和大酒店各种会所及连锁店等，2010年曾在昆山台湾企业裕元花圆大酒店担任总厨两年，现任苏州大禹国际总厨。', '意料', '20200617084223.jpg');
INSERT INTO `cooker` VALUES ('6', '奈杰尔·劳森', '一级大厨', '这一位顶尖厨师，也是非常的厉害，他的家庭也是非常的擅长烹饪，受家族的影响，他渐渐的也喜欢上了，这一门艺术，有了很高的成就，他是主持人的同时还出过很多有关烹饪的书籍，在世界上也是非常的有名气。', '面点', '20200617084914.jpg');
INSERT INTO `cooker` VALUES ('7', '杰米·特雷弗', '一级大厨', '排在第二名的这一位世界顶尖厨师，大应该更加的熟悉了吧，她自己录制过很多的节目，她将自己的美食，带给了我们大家，她出生于英国，是一个家喻户晓的人物，很多的人都佩服他，在这个世界上也有着很高的知名度，她的烹饪技术，炉火纯青。', '西餐', '20200617085020.png');
INSERT INTO `cooker` VALUES ('8', '瑞秋·雷', '特级厨师', '难得是一位女性，他是一名名副其实的女强人，它不仅仅是一名厨师，更是一个主持人，企业家等等等等，她的烹饪技术，非常的好，他的作品大多以简单为主，但是不失其精华，用最少的时间做最完美的料理。', '日料', '20200617085153.png');
INSERT INTO `cooker` VALUES ('9', '谢铁锋', '二级厨师', '谢铁锋不仅在美食行业闯出了名声，而且还开创了属于自己的全新独特风格。对于香味和色彩元素的诗意表达，不断创造出令人惊艳的创意菜品，受到了美食家和餐馆评论家的一致推崇。他创作出的菜品组合始终既精致又和谐。他对色彩的巧妙运用同样出类拔萃、独一无二。“每道菜都有一种主香味和主色调。', '川菜', '20200617085516.jpg');
INSERT INTO `cooker` VALUES ('10', '王一博', '高级厨师', '充满烹饪发现和乐趣的网络方式。与Andreas Caminada和其他著名厨师一起，王一博已创建了一个致力于传播烹饪乐趣享受生活理念的在线门户——王一博的LIFESTYLE,它将带您发现瑞士最佳餐厅风景背后的故事。各种各样的电影和访谈节目会向我们介绍明星级厨师的成功哲学和秘诀，我们会从他们的经历中得到一些灵感来提升自己的厨艺。', '粤菜', '20200617085658.png');
INSERT INTO `cooker` VALUES ('11', '吴磊磊', '特聘厨师', '全心全意、善解人意的东道主：吴磊磊是海拔 1083 米的雷厄托贝尔著名餐厅“Gupf”的厨师，擅长烹制经典偏小资的菜式，品尝菜肴时搭配私家酒窖的美酒则更是锦上添花。2003 年，这位 V-ZUG 品牌大使与妻子 Manuela 举家搬迁到了阿彭策尔山区，从此这对夫妇共同打造出一个享有盛名的世外桃源般的美食圣地。在这里可以吃到自家农场出产的肉制品，以及海里捕捞的高级海产品。磊磊 同时将“妈妈的味道”和传统美食呈现给客人。', '湘菜', '20200617085959.jpg');

