-- ----------------------------
-- Records of tbproduct
-- ----------------------------
INSERT INTO `tbproduct` VALUES ('23', '飞龙汤', '168', '浓郁鲜香，生津安神', '这道菜的名字听起来挺霸气的，。其实是将榛鸡脱毛去掉内脏后，用高汤煮熟即可，汤中不需放任何调料以保持汤原汁原味。这就是所谓的飞龙汤，飞是黑龙江省的名菜之一，属于龙江菜系。', '重庆', '0', '0', '20200617092424.jpg', '1');
INSERT INTO `tbproduct` VALUES ('24', '西湖醋鱼', '88', '鲜嫩酸甜，清淡爽口', '西湖醋鱼，真的是好吃的没办法说，这个菜在杭州的各个菜馆几乎都能看见，它通常选用草鱼作为原料，烹制而成。烧好后，浇上一层平滑油亮的糖醋，胸鳍竖起，鱼肉嫩美，带有蟹味，鲜嫩酸甜。', '重庆', '0', '0', '20200617092623.png', '1');
INSERT INTO `tbproduct` VALUES ('25', '水晶肴肉', '68', '光滑晶莹，卤冻透明', '水晶肴肉，是镇江的一道及其有名一道美食，至今最少已经有300多年的历史了，依旧没有失传。之所以将它的菜名里面加上水晶二字，是因为到最后做成菜之后，肉是红色的，外皮是白色的，光滑晶莹，卤冻透明，长相犹如水晶一样。', '重庆', '0', '0', '20200617092808.png', '1');
INSERT INTO `tbproduct` VALUES ('26', '无为熏鸭', '128', '食之酥香，回味无穷', '无为熏鸭又有另一个名字，无为板鸭，其实都是一个意思，它是安徽省无为县的一道很有名的传统特色名食，一开始出现的时候是在清朝年间。以巢湖麻鸭为原料，配以八角、花椒、丁香、小茴香等约30多种的中药和调料，先熏后卤，制作而成。', '重庆', '0', '0', '20200617093025.png', '1');
INSERT INTO `tbproduct` VALUES ('27', '火锅', '128', '肉质鲜美，', '重庆火锅，又称为毛肚火锅或麻辣火锅，是中国传统饮食方式，起源于明末清初的重庆嘉陵江畔、朝天门等码头船工纤夫的粗放餐饮方式，\r\n', '重庆', '0', '0', '20200617094949.png', '1');
INSERT INTO `tbproduct` VALUES ('28', '雪花牛排', '168', '肉质鲜美，Q弹爽口', '西方人爱吃较生口味的牛排，由于这种牛排含油适中又略带肉汁，口感甚是鲜美。东方人更偏爱7成熟，因为怕看到肉中带血，因此认为血水越少越好。', '重庆', '0', '0', '20200617095329.jpg', '1');
INSERT INTO `tbproduct` VALUES ('29', '水果salad', '48', '奶香浓郁，清爽可口', '蔬菜沙拉是一道 以圆白菜、番茄、黄瓜等作为主要食材制作而成的美食。蔬菜沙拉是一种非常营养健康的饮食方法。首先它大多不必加热，这样会最大限度的保持住蔬菜中的各种营养不至于被破坏或流失。', '重庆', '0', '0', '20200617095627.jpg', '1');
INSERT INTO `tbproduct` VALUES ('30', '迷彩蛋糕', '38', '精致诱人，', '甜品代表着甜美和爱情，这和法国人天性中的浪漫不谋而合，因此法国人对甜品有着一种特殊的偏爱，他们醉心于研究各种甜品，并在其中加入浪漫动人的元素，琳琅满目的法式甜品闪耀着精致诱人的光彩，让人不禁心向往之。', '重庆', '0', '0', '20200617095931.png', '1');
INSERT INTO `tbproduct` VALUES ('31', '刺身', '78', '肉质鲜美，Q弹爽口', '刺身是日本料理中最具特色的美食。据记载，公元14世纪时，日本人吃刺身便已经成为时尚，那时的人用“脍”字来概括刺身和类似刺身的食品。', '重庆', '0', '0', '20200617100259.png', '1');
INSERT INTO `tbproduct` VALUES ('32', '水果拼盘', '68', '酸甜诱人，美味可口', '用水果制作各种拼盘，是给人一种美的享受。首先要有好的命题，然后来挑选各种水果，利用水果的本色，来制作各种造型生动、形态各异的水果拼盘，诱人食欲。 水果拼盘是一种消滞和胃、增进食欲、美化宴席、烘托气氛、增进友谊的“水果工艺”作品。', '重庆', '0', '0', '20200617100644.jpg', '1');
INSERT INTO `tbproduct` VALUES ('33', '芙蓉蛋', '28', '松软滑嫩，清香滑口', '水蒸蛋是传统美食之一，是一道老少皆宜的家常食谱，南方人称之为“水蒸蛋”，北方人则称为“鸡蛋羹”。山东人和东北人多称其为“蒸蛋糕儿”。虽然“蒸蛋”看起来简单，不过还是有很多人做得不成功，不是水量放太多，从而导致水与蛋分离；就是水蛋蒸得过老，蛋体呈蜂窝状。要成功蒸出好吃的水蛋，需要控制好水量、水温、打蛋技巧和火候。', '重庆', '0', '0', '20200617101109.jpg', '1');

