-- ----------------------------
-- View structure for `v_cookerhasproduct`
-- ----------------------------
DROP VIEW IF EXISTS `v_cookerhasproduct`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_cookerhasproduct` AS select `cooker`.`cookername` AS `cookername`,`cooker`.`cookerlevel` AS `cookerlevel`,`cooker`.`cookerbreif` AS `cookerbreif`,`tbproduct`.`proname` AS `proname`,`tbproduct`.`price` AS `price`,`tbproduct`.`brief` AS `brief`,`tbproduct`.`descriptions` AS `descriptions`,`tbproduct`.`address` AS `address`,`tbproduct`.`imgurl` AS `imgurl`,`tbproduct`.`typeid` AS `typeid`,`cooker`.`specialfood` AS `specialfood`,`cooker`.`id` AS `id` from ((`cookerhasfood` left join `tbproduct` on((`cookerhasfood`.`proid` = `tbproduct`.`id`))) left join `cooker` on((`cookerhasfood`.`cookerid` = `cooker`.`id`))) ;

-- ----------------------------
-- View structure for `v_order`
-- ----------------------------
DROP VIEW IF EXISTS `v_order`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_order` AS select `tborderhead`.`sname` AS `sname`,`tborderhead`.`id` AS `id`,`tborderhead`.`orderid` AS `orderid`,`tborderhead`.`stel` AS `stel`,`tborderhead`.`saddress` AS `saddress`,`tborderhead`.`memberid` AS `memberid`,`tborderhead`.`ctime` AS `ctime`,`tborderhead`.`ptime` AS `ptime`,`tborderhead`.`memo` AS `memo`,`tborderitems`.`procount` AS `procount`,`tborderitems`.`price` AS `price`,`tborderitems`.`proname` AS `proname`,`tborderitems`.`proid` AS `proid`,`tborderitems`.`imgurl` AS `imgurl`,`tborderhead`.`sumprice` AS `sumprice` from (`tborderhead` join `tborderitems` on((`tborderhead`.`orderid` = `tborderitems`.`orderid`))) ;
